var fontForPdf;
var fontForPdfLoad = function(url) {
    var request = new XMLHttpRequest();
    request.onreadystatechange = function() {
        if (request.readyState === 4 && request.status === 200) {
            fontForPdf = request.response;
        }
    };
    request.open('GET', url, true);
    request.responseType = "arraybuffer";
    request.send(null);
};
fontForPdfLoad('//fonts.gstatic.com/s/courgette/v5/BHG8ZtTfO0yYnp02--QxqiZ2oysoEQEeKwjgmXLRnTc.ttf');

function svgToPdf(svgElement, canvas) {
    $("#print-modal").modal('show');
    $("#print-ready").hide();
    $("#print-please-wait").show();

    setTimeout(function() {
        svgToPdf2(svgElement, canvas);
    }, 2000);
}

function svgToPdf2(svgElement, canvas) {
    var $svgElement = $(svgElement);
    var $canvas;

    if (!canvas) {
        $canvas = $(document.createElement('canvas'));
        $canvas.css('width', $svgElement.width() + 'px');
        $canvas.css('height', $svgElement.height() + 'px');
        //$canvas.css('display', 'none');
        $("body").append($canvas);
    } else {
        $canvas = $(canvas);
    }

    // Work around an issue where cropping the images into circles works different in the PDF render versus the actual SVG:
    var svgStr = new XMLSerializer().serializeToString($svgElement[0]);
    svgStr = svgStr.replace(/objectBoundingBox/g, "userSpaceOnUse");
    svgStr = svgStr.replace(
        /<image([^>]+)x="0" y="0"([^>]+)data-pdf-x="([0-9\.\-]+px)" data-pdf-y="([0-9\.\-]+px)"/g,
        '<image$1$2x="$3" y="$4"'
    );

    canvg($canvas[0], svgStr, {
        renderCallback: function() {
            var pageWidth = 792;
            var pageHeight = 612;
            var pageAspectRatio = pageHeight / pageWidth;

            var imageWidth = $canvas.width();
            var imageHeight = $canvas.height();
            var imageAspectRatio = imageHeight / imageWidth;

            imageWidth = pageWidth;
            imageHeight = imageWidth * imageAspectRatio;

            // create a document and pipe to a blob
            var doc = new PDFDocument({autoFirstPage: false});
            doc.registerFont('Courgette', fontForPdf);
            doc.font('Courgette');
            doc.fontSize(20);
            var page = doc.addPage({size: [pageWidth, pageHeight], margins: {top: 0, left: 0, right: 0, bottom: 0}});
            var stream = doc.pipe(blobStream());

            doc.image("data:image/png;base64,",
                pageWidth / 2 - (pageWidth * 0.7) / 2,
                72,
                {
                    width: pageWidth * 0.7,
                    height: pageHeight * 0.7
                }
            );

            var title = "";
            if (window.rootUserName) {
                title = window.rootUserName + "'s Family Tree";
            } else {
                title = "Family Tree";
            }

            doc.text(title, pageWidth / 2 - doc.widthOfString(title) / 2, 20);
            doc.image($canvas[0].toDataURL(), 0, 40, {width: imageWidth, height: imageHeight});
            var footerText = "Produced by Kulbeli";
            doc.fontSize(18);
            doc
                .fillColor('#777777')
                .text(footerText, pageWidth / 2 - doc.widthOfString(footerText) / 2, pageHeight - 48 - 20);

            doc.image(
                "data:image/png;base64,",
                pageWidth / 2 + doc.widthOfString(footerText) / 2 + 4,
                pageHeight - 52 - 20,
                {
                    width: 28,
                    height: 28
                }
            );

            // end and display the document in the iframe to the right
            doc.end();
            stream.on('finish', function() {
                var blobUrl = stream.toBlobURL('application/pdf');
                $("#print-iframe")[0].src = blobUrl;
                $("#print-ready").show();
                $("#print-please-wait").hide();

                var $downloadLink = $("#print-download-link");
                $downloadLink.show().attr("href", blobUrl);

                if(window.navigator.msSaveOrOpenBlob) {
                    $downloadLink.off('click').on('click', function() {
                        window.navigator.msSaveOrOpenBlob(stream.toBlob(), "family-tree-" + Date.now() + ".pdf");
                    });
                }
            });
        }
    });
}